import Header from "./components/Header";


export interface AppModel  {
    message: string,
}


function App (props: AppModel) {
    return (
        <>
        <Header />
        <div className="container">
            
        </div>
        <p>{props.message}</p>
        </>
        
    )
}

export default App;
